import React, { Component } from 'react'
import FBButton from './FBButton';
export default class Home extends Component {

    onLogout = () => {
        this.props.senData()
    }
    render() {
        return (
            <div>
                <h1>Welcome </h1>
                <button onClick={this.onLogout}>Logout</button>
            </div>
        )
    }
}
